    switch (theme) {
        default:
            mentors = [
                'Eric Schmidt',
                'Mark Zuckerberg',
                'Larry Page',

            ]
    }

    return (
        <BaseCarousel show={2}>
            <ProfileCard name='Larry Page' />
            <ProfileCard name='Elon Musk' />
            <ProfileCard name='Mark Zuckerberg' />
            <ProfileCard name='Eric Schmidt' />
            <ProfileCard name='Bill Gates' />
